import React from 'react';
import './MainSection.css';
const image = process.env.PUBLIC_URL + '/group.jpg';

const MainSection = () => {
    return (
        <div className="main-section">
            <div className="mainsection-tab-container">
                <div className="main-section-content">
                    <div className="maintitle">Welcome to the Stanford Vision and Learning Lab (SVL)</div>
                    <p>We at the Stanford Vision and Learning Lab (SVL) tackle fundamental open problems in computer vision research. We are intrigued by visual functionalities that give rise to semantically meaningful interpretations of the visual world.</p>
                    <p><b>Join us</b>: If you are interested in research opportunities at SVL, please fill out this <a href="link-to-application">application survey</a>. (Stanford students only)</p>
                </div>
                <div className="image-container">
                    <img src={image} alt="Stanford Vision and Learning Lab" />
                </div>
            </div>
        </div>
    );
};

export default MainSection;
